import React from 'react';
import PrescriptionUpload from './components/PrescriptionUpload';
import DiagnosisForm from './components/DiagnosisForm';

const App = () => {
  return (
    <div className="App">
      <h1>MedIntel</h1>
      <PrescriptionUpload />
      <DiagnosisForm />
    </div>
  );
};

export default App;
